import React, { useState } from 'react';

function Bar(props) {
    const[bar,setBar]= useState([])
    useEffect(()=>{
        obtenerDatos()
      },[])
    const obtenerBar = async ()=>{
        const data = await fetch('http://hoteloasis.vicentealdhair.com/api/oasis/centro_consumo')
        const bares =await data.json()
        setBar(bares)
      }
    return (
        <div>
            <div className="container__bar">

            <ul>
                {!bar? '  Cargando...' : 
               bar.map(item=>(
                 <li>{item.nombre}</li>
               ))
              }
              </ul>
            </div>
            
        </div>
    );
}

export default Bar;
